import React, { useState, useEffect } from 'react';
import { documentService } from '../../services/documentService';
import FolderCard from '../common/FolderCard';
import FileCard from '../common/FileCard';
import '../../styles/components/SharedWithMe.css';

const SharedWithMe = () => {
  const [sharedDocuments, setSharedDocuments] = useState([]);
  const [publicDocuments, setPublicDocuments] = useState([]);
  const [loading, setLoading] = useState(true);
  const [activeTab, setActiveTab] = useState('shared');

  useEffect(() => {
    fetchSharedContent();
  }, []);

  const fetchSharedContent = async () => {
    setLoading(true);
    try {
      const [accessible, publicDocs] = await Promise.all([
        documentService.getAllDocuments(),
        documentService.getPublicDocuments()
      ]);
      
      // Filter out user's own documents to get only shared ones
      const myDocuments = await documentService.getMyDocuments();
      const myDocIds = myDocuments.map(doc => doc.id);
      const sharedOnly = accessible.filter(doc => !myDocIds.includes(doc.id));
      
      setSharedDocuments(sharedOnly);
      setPublicDocuments(publicDocs);
    } catch (error) {
      console.error('Error fetching shared content:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleViewDocument = (document) => {
    console.log('Viewing shared document:', document);
    // Implement document viewing logic
  };

  if (loading) {
    return <div className="loading">Loading shared content...</div>;
  }

  return (
    <div className="shared-with-me">
      <div className="shared-header">
        <h1>Shared with Me</h1>
        <p>Documents and folders that have been shared with you</p>
        
        <div className="tab-navigation">
          <button
            className={`tab ${activeTab === 'shared' ? 'active' : ''}`}
            onClick={() => setActiveTab('shared')}
          >
            Shared Documents
          </button>
          <button
            className={`tab ${activeTab === 'public' ? 'active' : ''}`}
            onClick={() => setActiveTab('public')}
          >
            Public Documents
          </button>
        </div>
      </div>

      <div className="shared-content">
        {activeTab === 'shared' && (
          <div className="tab-content">
            {sharedDocuments.length === 0 ? (
              <div className="empty-state">
                <svg width="64" height="64" viewBox="0 0 24 24" fill="none" className="empty-icon">
                  <path d="M16 1H4c-1.1 0-2 .9-2 2v14h2V3h12V1zm3 4H8c-1.1 0-2 .9-2 2v14c0 1.1.9 2 2 2h11c1.1 0 2-.9 2-2V7c0-1.1-.9-2-2-2zm0 16H8V7h11v14z" fill="#e0e0e0"/>
                </svg>
                <h3>No shared documents</h3>
                <p>Documents shared with you will appear here</p>
              </div>
            ) : (
              <div className="items-grid">
                {sharedDocuments.map(doc => (
                  <FileCard
                    key={doc.id}
                    document={doc}
                    onView={handleViewDocument}
                    onShare={() => {}}
                    onDelete={() => {}}
                    showActions={false}
                  />
                ))}
              </div>
            )}
          </div>
        )}

        {activeTab === 'public' && (
          <div className="tab-content">
            {publicDocuments.length === 0 ? (
              <div className="empty-state">
                <svg width="64" height="64" viewBox="0 0 24 24" fill="none" className="empty-icon">
                  <path d="M12 2C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm-2 15l-5-5 1.41-1.41L10 14.17l7.59-7.59L19 8l-9 9z" fill="#e0e0e0"/>
                </svg>
                <h3>No public documents</h3>
                <p>Public documents will appear here</p>
              </div>
            ) : (
              <div className="items-grid">
                {publicDocuments.map(doc => (
                  <FileCard
                    key={doc.id}
                    document={doc}
                    onView={handleViewDocument}
                    onShare={() => {}}
                    onDelete={() => {}}
                    showActions={false}
                  />
                ))}
              </div>
            )}
          </div>
        )}
      </div>
    </div>
  );
};

export default SharedWithMe;
